import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import SousOrder from "./SousOrder";
import {newItem} from "../../../Redux/later-seen-reducer";


class SousOrderContainer extends React.Component {


    render() {
        this.props.newItem(this.props.sous[this.props.match.params.id - 33])

        return (
            <SousOrder sous={this.props.sous} number={this.props.match.params.id - 33}
            />
        )
    }
}


let mapStateToprops = (state) => {
    return {
        sous: state.sousPage.sous,
    }
}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(SousOrderContainer)
